import React from 'react';

function Home() {

    const homeStyle = {
        backgroundImage: 'url("/images/construction1.jpg")',
        backgroundRepeat: 'no-repeat',
        backgroundSize: '100% auto',
        height: '100%'
    }

  return (
    <div style={ homeStyle } className="Home">
      {/* <h1>Home Page</h1> */}
    </div>
  );
}

export default Home;
